import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { ComplicationCrisesDouleureuse } from 'src/app/models/ComplicationCrisesDouleureuse';
import { CriseService } from 'src/app/services/crise.service';

@Component({
  selector: 'app-crise',
  templateUrl: './crise.component.html',
  styleUrls: ['./crise.component.css']
})
export class CriseComponent {
  crises: ComplicationCrisesDouleureuse[] = [new ComplicationCrisesDouleureuse()];
  errorMessage: string = '';

  constructor(private CriseService: CriseService) {}

  private formatDateToYYYYMMDD(date: Date): string {
    return date.toISOString().split('T')[0];
  }

  addCriseForm() {
    this.crises.push(new ComplicationCrisesDouleureuse());
  }

  onSubmit() {
    const now = new Date();

    this.crises.forEach(crise => {
      crise.Date = crise.Date ? this.formatDateToYYYYMMDD(new Date(crise.Date)) : this.formatDateToYYYYMMDD(now);

      // Convertir les dates en format ISO 8601 avant de les envoyer au backend
      const complicationToSend = {
        ...crise,
        DateEchocardiographie: new Date(crise.Date).toISOString(),
      };

      this.CriseService.addcrise(complicationToSend).subscribe(
        response => {
          console.log('Complication added successfully', response);
          this.errorMessage = '';
        },
        (error: HttpErrorResponse) => {
          console.error('Error adding complication', error);
          this.errorMessage = error.error.title;
          if (error.error.errors) {
            for (const [field, errors] of Object.entries(error.error.errors)) {
              console.error(`Validation error for ${field}:`, errors);
            }
          }
        }
      );
    });
  }
}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Patient Form</title>
  <style>
    .form-container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 20px;
      background-color: #f0f0f0;
    }

    .form-container h1 {
      text-align: center;
      font-size: 36px;
      font-weight: bold;
      color: #2c3e50;
      margin-bottom: 30px;
      font-family: 'Arial', sans-serif;
      text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
      border-bottom: 3px solid #3498db;
      padding-bottom: 10px;
      display: inline-block;
    }

    .form-container form {
      background-color: #f9f9f9;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    }

    .form-container form div {
      margin-bottom: 15px;
    }

    .form-container form label {
      display: block;
      margin-bottom: 5px;
      font-weight: bold;
      text-transform: capitalize;
    }

    .form-container form input,
    .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
    }

    .form-container form .submit-row {
      text-align: center;
      margin-top: 20px;
    }

    .form-container form input[type="submit"] {
      background-color: #000 !important;
      color: #fff !important;
      padding: 12px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }

    .form-container form input[type="submit"]:hover {
      background-color: #444;
      color: #fff;
    }
    /* Style for Add Crise Button */
.add-crise-button {
  background-color: #3498db;
  color: #fff;
  padding: 12px 20px;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  transition: background-color 0.3s ease, transform 0.3s ease;
  font-size: 16px;
  font-weight: bold;
}

.add-crise-button:hover {
  background-color: #2980b9;
  transform: scale(1.05);
}

.add-crise-button:focus {
  outline: none;
}


    .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
      background-color: #fff;
      font-size: 16px;
      cursor: pointer;
      appearance: none;
      -webkit-appearance: none;
      -moz-appearance: none;
      background-image: url('data:image/svg+xml;utf8,<svg fill="currentColor" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M7.68 11.895a.75.75 0 0 1-1.06-1.06L7.94 9.44V5.75a.75.75 0 0 1 1.5 0v3.69l1.32 1.33a.75.75 0 0 1-1.06 1.06L8 10.56l-.32.32z"/></svg>');
      background-repeat: no-repeat;
      background-position: right 10px top 50%, 0 0;
      background-size: 16px auto, 100%;
    }

    .radio-group {
      display: flex;
      align-items: center;
      gap: 15px;
    }

    .radio-group input[type="radio"] {
      margin-right: 5px;
    }

    .radio-group label {
      margin: 0;
    }

    .conditional-fields {
      margin-top: 15px;
    }

    .checkbox-group {
      display: flex;
      flex-wrap: wrap;
      gap: 20px;
    }

    .form-container h2 {
      text-align: center;
      font-size: 30px;
      font-weight: bold;
      color: #c95355;
      margin-bottom: 30px;
      font-family: 'Arial', sans-serif;
      text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
      border-bottom: 3px solid #f12349;
      padding-bottom: 10px;
      display: inline-block;
    }
    .checkbox-group div {
      display: flex;
      align-items: center;
      gap: 5px;
    }

  </style>
</head>
<body>
  <div class="form-container">
    <form (ngSubmit)="onSubmit()">
      <h1>Complication de la drepanocytose    </h1>
      <h2>Crises douleureuses</h2>
      <div *ngFor="let crise of crises; let i = index">
        <!-- Patient Id-->
        <div>
          <label for="PatientId-{{i}}">PatientId</label>
          <input type="number" id="PatientId-{{i}}" [(ngModel)]="crise.PatientId" name="PatientId-{{i}}">
        </div>

        <!-- Crises douloureuses -->
        <div>
          <label>Crises douloureuses:</label>
          <div class="radio-group">
            <!-- Oui radio button first -->
            <input type="radio" id="CrisesDouleureuseOui-{{i}}" [(ngModel)]="crise.CrisesDouleureuse" [value]="true" name="CrisesDouleureuse-{{i}}">
            <label for="CrisesDouleureuseOui-{{i}}">Oui</label>
            
            <!-- No radio button second -->
            <input type="radio" id="CrisesDouleureuseNon-{{i}}" [(ngModel)]="crise.CrisesDouleureuse" [value]="false" name="CrisesDouleureuse-{{i}}">
            <label for="CrisesDouleureuseNon-{{i}}">Non</label>
          </div>
        </div>
        
        <!-- Nombre -->
        <div *ngIf="crise.CrisesDouleureuse">
          <label for="Nombre-{{i}}">Nombre:</label>
          <input type="number" id="Nombre-{{i}}" [(ngModel)]="crise.Nombre" name="Nombre-{{i}}">
        </div>

        <!-- Date -->
        <div *ngIf="crise.CrisesDouleureuse">
          <label for="Date-{{i}}">Date :</label>
          <input type="date" id="Date-{{i}}" [(ngModel)]="crise.Date" name="Date-{{i}}">
        </div>
        
        <!-- Siege -->
        <div *ngIf="crise.CrisesDouleureuse">
          <label for="Siege-{{i}}">Siege:</label>
          <input type="text" id="Siege-{{i}}" [(ngModel)]="crise.Siege" name="Siege-{{i}}">
        </div>
          <!-- Traitement -->
          <div class="conditional-fields" *ngIf="crise.CrisesDouleureuse">
            <label for="Traitement-{{i}}">Traitement:</label>
            <div class="checkbox-group">
              <div>
                <input type="checkbox" id="ConclusionAuxUrgence-{{i}}" [(ngModel)]="crise.ConclusionAuxUrgence" name="ConclusionAuxUrgence-{{i}}">
                <label for="ConclusionAuxUrgence-{{i}}">Conclusion Aux Urgences</label>
              </div>
              <div>
                <input type="checkbox" id="Hospitalisation-{{i}}" [(ngModel)]="crise.Hospitalisation" name="Hospitalisation-{{i}}">
                <label for="Hospitalisation-{{i}}">Hospitalisation</label>
              </div>
              <div>
                <input type="checkbox" id="HyperhydratationPerso-{{i}}" [(ngModel)]="crise.HyperhydratationPerso" name="HyperhydratationPerso-{{i}}">
                <label for="HyperhydratationPerso-{{i}}">Hyperhydratation Perso</label>
              </div>
              <div>
                <input type="checkbox" id="HyperhydratationIv-{{i}}" [(ngModel)]="crise.HyperhydratationIv" name="HyperhydratationIv-{{i}}">
                <label for="HyperhydratationIv-{{i}}">Hyperhydratation IV</label>
              </div>
              <div>
                <input type="checkbox" id="AntalgiquesPalliersI-{{i}}" [(ngModel)]="crise.AntalgiquesPalliersI" name="AntalgiquesPalliersI-{{i}}">
                <label for="AntalgiquesPalliersI-{{i}}">Antalgiques Palliers I</label>
              </div>
              <div>
                <input type="checkbox" id="AntalgiquesPalliersIi-{{i}}" [(ngModel)]="crise.AntalgiquesPalliersIi" name="AntalgiquesPalliersIi-{{i}}">
                <label for="AntalgiquesPalliersIi-{{i}}">Antalgiques Palliers II</label>
              </div>
              <div>
                <input type="checkbox" id="AntalgiquesPalliersIii-{{i}}" [(ngModel)]="crise.AntalgiquesPalliersIii" name="AntalgiquesPalliersIii-{{i}}">
                <label for="AntalgiquesPalliersIii-{{i}}">Antalgiques Palliers III</label>
              </div>
              <div>
                <input type="checkbox" id="TransfusionSimple-{{i}}" [(ngModel)]="crise.TransfusionSimple" name="TransfusionSimple-{{i}}">
                <label for="TransfusionSimple-{{i}}">Transfusion Simple</label>
              </div>
              <div>
                <input type="checkbox" id="EchangeTransfusionnel-{{i}}" [(ngModel)]="crise.EchangeTransfusionnel" name="EchangeTransfusionnel-{{i}}">
                <label for="EchangeTransfusionnel-{{i}}">Échange Transfusionnel</label>
              </div>
            </div>
          </div>
        </div>

      <!-- Add Crise Button -->
      <div class="submit-row">
        <button class="add-crise-button" type="button" (click)="addCriseForm()">Ajouter une crise</button>
      </div>

      <!-- Submit Button -->
      <div class="submit-row">
        <input type="submit" value="Submit">
      </div>
    </form>
  </div>
</body>
</html>
